import {useState, useEffect} from 'react';
import React, {Component} from 'react';
import "./App.css"
import Button from 'react-bootstrap/Button';
import axios from 'axios';

class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
          loggedIn: false,
          server: "http://localhost:3300"
      }
    }
    async onClick() { 
      try {
        let response = await axios.get(this.server + "/manager/employee-list/");
        console.log(response)
      }
      catch(e) {
        alert("Server is not running.");
      }
    }
    render () {
      return (
        <div>
          <h1>Log-In</h1>
          <Button onClick={this.onClick} variant="Test">Test</Button>
        </div>
      );
    }
}

export default App;
